            "can_edit": false,
            "text_raw": "【#新东方辞退拒调岗员工被判赔38.25万#】7月12日，北京法院审判信息网公开北京新东方迅程网络科技股份有限公司与葛某劳动争议二审民事判决书。审理法院为北京市第一中级人民法院。\n\n判决书显示，新东方以葛某不服从公司因生产经营需要做出的岗位调整安排，未到新岗位报到为由解除劳动合同，葛某认为调 ​",
